MathJax.Localization.addTranslation("de","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax nutz web-basierte Fonts zur Darstellung der Mathematik auf dieser Seite. Da diese heruntergeladen werden m\xFCssen, l\xE4dt die Seite schneller, wenn Mathe-Fonts auf dem System installiert sind.",imageFonts:"MathJax verwendet die Bildschriften anstatt der lokalen oder webbasierten Schriften. Das Rendern dauert l\xE4nger als gew\xF6hnlich und die Inhalte werden m\xF6glicherweise nicht mit der vollen Aufl\xF6sung deines Druckers ausgedruckt.",noFonts:"MathJax konnte keine Schriftart zur Anzeige der Inhalte finden und Bildschriften sind nicht verf\xFCgbar. Es wird auf allgemeine Unicode-Zeichen zur\xFCckgegriffen in der Hoffnung, dass dein Browser in der Lage ist, sie darzustellen. Einige Zeichen werden m\xF6glicherweise nicht richtig oder gar nicht angezeigt.",webFonts:"Die meisten modernen Browser erlauben den Download von Schriften \xFCber das Web. Eine Aktualisierung auf eine aktuellere Version deines Browsers (oder dessen Wechsel) kann die Qualit\xE4t der Inhalte auf dieser Seite verbessern.",fonts:"MathJax kann entweder die [STIX-](%1) oder [MathJax-TeX-Schriften](%2) verwenden. Lade eine dieser Schriften herunter und installiere sie, um dein MathJax-Erlebnis zu steigern.",STIXPage:"Diese Seite wurde konzipiert, um die [STIX-Schriften](%1) zu verwenden. Lade sie herunter und installiere sie, um dein MathJax-Erlebnis zu steigern.",TeXPage:"Diese Seite wurde konzipiert, um die [MathJax-TeX-Schriften](%1) zu verwenden. Lade sie herunter und installiere sie, um dein MathJax-Erlebnis zu steigern."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/de/FontWarnings.js");
